This is a set of just over 20,000 games collected from a selection of users on the site Lichess.org, and how to collect more. I will also upload more games in the future as I collect them. This set contains the:

\n- Game ID;
\n- Rated (T/F);
\n- Start Time;
\n- End Time;
\n- Number of Turns;
\n- Game Status;
\n- Winner;
\n- Time Increment;
\n- White Player ID;
\n- White Player Rating;
\n- Black Player ID;
\n- Black Player Rating;
\n- All Moves in Standard Chess Notation;
\n- Opening Eco (Standardised Code for any given opening, list here);
\n- Opening Name;
\n- Opening Ply (Number of moves in the opening phase)

For each of these separate games from Lichess. I collected this data using the Lichess API, which enables collection of any given users game history. The difficult part was collecting usernames to use, however the API also enables dumping of all users in a Lichess team. There are several teams on Lichess with over 1,500 players, so this proved an effective way to get users to collect games from.

**Possible Uses**

Lots of information is contained within a single chess game, let alone a full dataset of multiple games. It is primarily a game of patterns, and data science is all about detecting patterns in data, which is why chess has been one of the most invested in areas of AI in the past. This dataset collects all of the information available from 20,000 games and presents it in a format that is easy to process for analysis of, for example, what allows a player to win as black or white, how much meta (out-of-game) factors affect a game, the relationship between openings and victory for black and white and more.

Use Case

This dataset consists of over 1,000,000 tweets scraped from Twitter for 8 different financial symbols from late 2017 to mid 2018. Each csv file contains the tweet text and accompanying metadata. It can be used to analyze trends in social media behavior and can be used to train automatic trading model using sentiment analysis. See my other product of stock market price data: <a href="https://market.oceanprotocol.com/asset/did:op:0D535c79fdA3A261Bea9404223ed32BA382e5993">US Stock Price Data</a>.

Dataset

Timeframe of tweets: October 27, 2017 - July 16, 2018

1,034,026 Total tweets:

Apple(AAPL): 289,034
Telsa(TSLA): 321,866
S&P 500 (SP500): 119,866
Dow Jones index (DJIA): 86,399
Bitcoin(BTC): 42,457
French stock exchange(CAC): 34,470
German stock exchange(DAX): 140,374

Each csv contain a table with the following columns:

text: string of the tweet text;
favorited: TRUE/FALSE;
favoriteCount: number of times tweet was favorited;
replyToSN: screen name of person tweet is replying to;
created: date/time of tweet;
truncated: TRUE/FALSE;
replyToSID: unique tweet ID of the tweet it is replying to;
id: unique tweet ID supplied by Twitter;
replyToUID: user ID number of person tweet is replying to;
statusSource: source of tweet (eg. iPhone, Android, web,...);
screenName: screen name of person tweeting;
retweetCount: number of time retweeted;
isRetweet: TRUE/FALSE;
retweeted: TRUE/FALSE;
longitude: if available;
latitude: if available

18k+ FIFA 21 players, 100+ attributes extracted from the latest FIFA database

Context
The datasets provided include the players data for the Career Mode from FIFA 15 to FIFA 21 ("players_21.csv"). The data allows multiple comparison of the same players across the last 7 version of the videogame.

Some ideas of possible analysis:

-Historical comparison between Messi and Ronaldo (what skill attributes changed the most during time compared to reallife stats);
-Make your dream team;
-Analyse which Club or National Team has the best-rated players;
-Assess the strength of a team at a particular position;
-Analyse the team with the best dribbling speed;
-Co-relate between Age and Overall rating;
-Co-relate between Age and Nationality;
-Co-relate between Age and Potential;
-Could prove of immense value to Fantasy Premier League enthusiasts.

These are just basic examples, sky is the limit.

Ideal budget to create a competitive team (at the level of top n teams in Europe) and at which point the budget does not allow to buy significantly better players for the 11-men lineup. An extra is the same comparison with the Potential attribute for the lineup instead of the Overall attribute;

Sample analysis of top n% players (e.g. top 5% of the player) to see if some important attributes as Agility or BallControl or Strength have been popular or not acroos the FIFA versions. An example would be seeing that the top 5% players of FIFA 21 are more fast (higher Acceleration and Agility) compared to FIFA 15. The trend of attributes is also an important indication of how some attributes are necessary for players to win games (a version with more top 5% players with high BallControl stats would indicate that the game is more focused on the technique rather than the physicial aspect).

data.csv includes lastest edition FIFA 2021 players attributes like Age, Nationality, Overall, Potential, Club, Value, Wage, Preferred Foot, International Reputation, Weak Foot, Skill Moves, Work Rate, Position, Jersey Number, Joined, Loaned From, Contract Valid Until, Height, Weight, LS, ST, RS, LW, LF, CF, RF, RW, LAM, CAM, RAM, LM, LCM, CM, RCM, RM, LWB, LDM, CDM, RDM, RWB, LB, LCB, CB, RCB, RB, Crossing, Finishing, Heading, Accuracy, ShortPassing, Volleys, Dribbling, Curve, FKAccuracy, LongPassing, BallControl, Acceleration, SprintSpeed, Agility, Reactions, Balance, ShotPower, Jumping, Stamina, Strength, LongShots, Aggression, Interceptions, Positioning, Vision, Penalties, Composure, Marking, StandingTackle, SlidingTackle, GKDiving, GKHandling, GKKicking, GKPositioning, GKReflexes, and Release Clause.

W3C Web Speech API - Speech synthesis plugin for PhoneGap

**Installation**
___
**Phone Gap**\
Using the command line tools run:
```
phonegap plugin add https://github.com/macdonst/SpeechSynthesisPlugin
cordova plugin add https://github.com/macdonst/SpeechSynthesisPlugin
```
**Cordova**
___
This plugin also works with the Apache Cordova toolset. See this Github project for an example for Android:
```
https://github.com/andysylvester/talk-to-me-cordova
```
More info on using this plugin with Cordova is available at this [blog post](http://andysylvester.com/2014/02/08/first-steps-with-cordova-talk-to-me/).
**Example Code**
___
This code from the above Github project shows how to read the value of a text field, set up the plugin to speak that text, and vibrate the phone for 2 seconds:
```
function playVibrate() {
    var u = new SpeechSynthesisUtterance();
    var x = document.getElementById("frm1");
    var txt = "";
    txt = x.elements[0].value
    u.text = txt;
    u.lang = 'en-US';
    speechSynthesis.speak(u);      
    navigator.notification.vibrate(2000);
    document.getElementById("frm1").reset();
  }
```
